// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./interfaces/IUniswapV2Router.sol";
import "./interfaces/IAaveLendingPool.sol";

contract ArbitrageEstimator {
    address public owner;
    IAaveLendingPool private aaveLendingPool;

    // Modificador para restringir el acceso solo al propietario
    modifier onlyOwner() {
        require(msg.sender == owner, "owner invalid");
        _;
    }

    constructor(address _aaveLendingPoolAddress) {
        owner = msg.sender; // Establece el propietario al desplegar el contrato
        aaveLendingPool = IAaveLendingPool(_aaveLendingPoolAddress);
    }

    // Estima el retorno de un swap de `amountIn` del `tokenIn` al `tokenOut` en DEX A y DEX B
    // Ahora restringido solo al propietario
    function estimateSwap(
        address routerA,
        address routerB,
        address tokenIn,
        address tokenOut,
        uint amountIn
    ) external view onlyOwner returns (uint amountOutA, uint amountOutB) {
        address[] memory path = new address[](2);
        path[0] = tokenIn;
        path[1] = tokenOut;

        // Estimación en DEX A
        uint[] memory amountsOutA = IUniswapV2Router(routerA).getAmountsOut(amountIn, path);
        amountOutA = amountsOutA[1];



        // Estimación en DEX B
        uint[] memory amountsOutB = IUniswapV2Router(routerB).getAmountsOut(amountIn, path);
        amountOutB = amountsOutB[1];
    }

    // Obtiene la comisión de flash loan de Aave
    // Esta función no necesita restricción ya que no modifica el estado y es de solo lectura
    function getAaveFlashLoanFeePercentage() external view returns (uint256) {
        return aaveLendingPool.flashLoanFeePercentage();
    }

    // Función para transferir la propiedad del contrato
    // Solo el propietario actual puede ejecutar esta función
    function transferOwnership(address newOwner) public onlyOwner {
        require(newOwner != address(0), "No valid address");
        owner = newOwner;
    }
}

